import json
import os
import torch

def collectMapsFromReplays():
    inDir = "/UltraKeks/Dev/rl/vindinium/games/recent-games/"
    replays = os.listdir(inDir)
    ofile = open("tmp.txt", "w")
    for replay in replays:
        fullpath = os.path.join(inDir, replay)
        with open(fullpath) as file:
            txt = file.readline()[6:]
            c = json.loads(txt)
            ofile.write("msizes.append(" + str(c['board']['size']) + ");maps.append(\"" + c['board']['tiles']+"\");\n")
        
    ofile.close()

