def printMapFromEncoded(encoded, size):
    lineCount = int(len(encoded) / 2 / size)
    for l in range(lineCount):
        print(encoded[l*2*size:(l+1)*2*size])

def findSpawnLocation(mapEncoded, mapSize, heroId):
    idx = mapEncoded.index("@" + str(heroId))
    r = dict()
    r['x'] = int(idx / 2 / mapSize)
    r['y'] = int(idx / 2 % mapSize)
    return r

# produces a dict as it would represent an initial game state from the server on a random map
# the hero propertes that decribes the current players hero is missing, as this is general for every player
def initGameState(maxTurns = 120):
    r = dict()
    r['game'] = dict()
    g = r['game']
    g['id'] = str(random.randint(0, 999999999))
    g['turn'] = 0
    g['maxTurns'] = maxTurns
    g['board'] = dict()
    gb = g['board']
    
    mapIndex = random.randint(0, len(msizes)-1)
    
    gb['size'] = msizes[mapIndex]
    gb['tiles'] = maps[mapIndex]
    
    g['heroes'] = []
    for hid in range(1, 5):
        h = dict()
        h['id'] = hid
        h['name'] = 'hero_'+str(hid)
        h['userId'] = h['name'] + "_id"
        h['elo'] = -1
        h['pos'] = findSpawnLocation(gb['tiles'], gb['size'], hid)
        h['life'] = 100
        h['gold'] = 0
        h['mineCount'] = 0
        h['spawnPos'] = h['pos']
        h['crashed'] = False
        g['heroes'].append(h)
    return r

