class Hero(object):
    '''Represents a hero in the game.
    Attributes:
        id (int): the hero's id.
        name (string): the bot's name.
        user_id (string): the bot's id (None in training mode).
        elo (int): the bot's ELO (None in training mode).
        crashed (bool): True if the bot has been disconnected. 
        mine_count (int): the number of mines this hero owns.
        gold (int): current amount of gold earned by this hero.
        life (int): current hero's life.
        last_dir (string): last bot movement (may be None).
        x (int): the bot's position in the X axis.
        y (int): the bot's position in the Y axis.
        spawn_x (int): the bot's spawn position in X.
        spawn_y (int): the bot's spawn position in Y.
    '''
    
    def __init__(self, hero):
        '''Constructor.
        
        Args:
            hero (dict): the hero data from the server.
        '''
        # Constants
        self.id         = hero['id']
        self.name       = hero['name']
        self.user_id    = hero.get('userId')
        self.elo        = hero.get('elo')
        
        # Variables
        self.crashed    = hero['crashed']
        self.mine_count = hero['mineCount']
        self.gold       = hero['gold']
        self.life       = hero['life']
        self.last_dir   = hero.get('lastDir')
        self.x          = hero['pos']['y']
        self.y          = hero['pos']['x']
        self.spawn_x    = hero['spawnPos']['y']
        self.spawn_y = hero['spawnPos']['x']

class Map(object):
    '''Represents static elements in the game, such as walls, paths, taverns, 
    mines and spawn points.

    Attributes:
        size (int): the board size (in a single axis).
    '''
    
    def __init__(self, size):
        '''Constructor.
        
        Args:
            size (int): the board size.
        '''
        self.size = size
        self.__board = [[0 for _ in range(size)] for _ in range(size)]

    def __getitem__(self, key):
        '''Returns an item in the map.'''
        return self.__board[key[0]][key[1]]

    def __setitem__(self, key, value):
        '''Sets an item in the map.'''
        self.__board[key[0]][key[1]] = value

    def __str__(self):
        '''Pretty map.'''
        s = ' '
        s += '-'*(self.size) + '\n'
        for y in range(self.size):
            s += '|'
            for x in range(self.size):
                s += str(self[x, y] or ' ')
            s += '|\n'
        s += ' ' + '-'*(self.size)
        return s

class Mine(object):
    '''A mine object.
    
    Attributes:
        x (int): the mine position in X.
        y (int): the mine position in Y.
        owner (int): the hero's id that owns this mine.
    '''
    
    def __init__(self, x, y):
        '''Constructor.

        Args:
            x (int): the mine position in X.
            y (int): the mine position in Y.
        '''
        self.x = x
        self.y = y
        self.owner = None

class Tavern(object):
    '''A tavern.

    Attributes:
        x (int): the tarven position in X.
        y (int): the tarven position in Y.
    '''

    def __init__(self, x, y):
        '''Constructor

        Args:
            x (int): the mine position in X.
            y (int): the mine position in Y.
        '''
        self.x = x
        self.y = y

class Game(object):
    '''Represents a game.

    A game object holds information about the game and is updated automatically
    by ``BaseBot``.

    Attributes:
        id (int): the game id.
        max_turns (int): maximum turns of the game (notice that each turn only
          a single hero moves).
        turn (int): current turn.
        map (vindinium.models.Map): a map instance.
        heroes (list): a list of Hero instances.
        mines (list): a list of Mine instances.
        taverns (list): a list of Tavern instances.
    '''

    def __init__(self, state):
        '''Constructor.

        Args:
            state (dict): the state object.
        '''
        # Constants
        self.id = state['game']['id']
        self.max_turns = state['game']['maxTurns']
        
        # Variables
        self.turn = state['game']['turn']

        # Processed objects
        self.map = None
        self.heroes = []
        self.mines = []
        self.taverns = []

        # Process the state, creating the objects
        self.__processState(state)

    def update(self, state):
        '''Updates the game with new information.

        Notice that, this function does not re-create the objects, just update
        the current objects with new information.

        Args:
            state (dict): the state object.
        '''
        size = state['game']['board']['size']
        tiles = state['game']['board']['tiles']
        heroes = state['game']['heroes']
        
        self.turn = state['game']['turn']
        
        for hero, hero_state in zip(self.heroes, heroes):
            hero.crashed    = hero_state['crashed']
            hero.mine_count = hero_state['mineCount']
            hero.gold       = hero_state['gold']
            hero.life       = hero_state['life']
            hero.last_dir   = hero_state.get('lastDir')
            hero.x          = hero_state['pos']['y']
            hero.y          = hero_state['pos']['x']

        for mine in self.mines:
            char = tiles[mine.x*2 + mine.y*2*size + 1]
            mine.owner = None if char == '-' else int(char)

    def __processState(self, state):
        '''Process the state.'''
        # helper variables
        board = state['game']['board']
        size = board['size']
        tiles = board['tiles']
        tiles = [tiles[i:i+2] for i in range(0, len(tiles), 2)]

        # run through the map and update map, mines and taverns
        self.map = Map(size)
        self.mapSize = size
        for y in range(size):
            for x in range(size):
                tile = tiles[y*size+x]
                if tile == '##':
                    self.map[x, y] = TILE_WALL
                elif tile == '[]':
                    self.map[x, y] = TILE_TAVERN
                    self.taverns.append(Tavern(x, y))
                elif tile.startswith('$'):
                    self.map[x, y] = TILE_MINE
                    self.mines.append(Mine(x, y))
                else:
                    self.map[x, y] = TILE_EMPTY

        # create heroes
        for hero in state['game']['heroes']:
            pos = hero['spawnPos']
            self.map[pos['y'], pos['x']] = TILE_SPAWN
            self.heroes.append(Hero(hero))

    def __str__(self):
        '''Pretty map.'''
        s = ' '
        s += '-'*(self.map.size) + '\n'
        for y in range(self.map.size):
            s += '|'
            for x in range(self.map.size):
                tile = self.map[x, y]
                hero = [h for h in self.heroes if h.x==x and h.y==y]

                if tile == TILE_WALL: s += '#'
                elif any(hero): s+= str(hero[0].id)
                elif tile == TILE_SPAWN: s += 's'
                elif tile == TILE_MINE: s += 'M'
                elif tile == TILE_TAVERN: s += 'T'
                else: s += ' '
            s += '|\n'
        s += ' ' + '-'*(self.map.size)
        return s

class VindiniumStateFrame(object):
    def __init__(self, turn, playerCount, tensor):
        self.turn = turn
        self.playerCount = playerCount
        self.tensor = tensor.clone()
        
    def mapPlayerIndexToTurnRel(self, playerIndex):
        t = self.turn
        pc = self.playerCount
        return (playerIndex - (t % pc)) % pc

class VindiniumState(AbstractState):
    
    def __init__(self, game=None, maxTurns=160):
        if isinstance(game, VindiniumState):
            self.last_move = game.last_move
            self.turn = game.turn
            self.heroes = [h.copy() for h in game.heroes]
            self.mines = game.mines.copy()
            self.xOff = game.xOff
            self.yOff = game.yOff
            self.max_turns = game.max_turns
            self.mapSize = game.mapSize
            self.map = game.map
            self.tensor = game.tensor.clone()
        else:
            if game == None:
                game = Game(initGameState(maxTurns))
            self.last_move = None
            self.turn = game.turn
            self.heroes = []
            self.mines = {}
            self._populate(game)
            
            if game.mapSize == 28:
                self.xOff = 0
                self.yOff = 0
            else:
                self.xOff = random.randint(0, 28 - game.mapSize - 1)
                self.yOff = random.randint(0, 28 - game.mapSize - 1)
                
            self.tensor = torch.zeros(7, 28, 28)
            self.map = game.map
            self.max_turns = game.max_turns
            self.mapSize = game.mapSize
            self.writeAllStateToTensor()

    def getNewGame(self):
        return VindiniumState(maxTurns= self.max_turns)

    def getFrameClone(self):
        return VindiniumStateFrame(self.turn, self.getPlayerCount(), self.tensor)

    def writeAllStateToTensor(self):
        self.tensor.fill_(0)
        
        moneySum = 0.0
        for h in self.heroes:
            moneySum += float(h['gold'])
            
        mineSum = float(len(self.mines))
        
        for y in range(self.mapSize):
            for x in range(self.mapSize):
                v = [0,0,0,0,0,0,0]
                if self.map[x,y] == TILE_WALL:
                    v[0] = 0.25
                elif self.map[x,y] == TILE_MINE:
                    v[0] = 0.75
                    mOwner = self.mines[x,y]
                    if mOwner != None:
                        v[1] = (1+self.mapPlayerIndexToTurnRel(mOwner-1)) / 4.0
                elif self.map[x,y] == TILE_TAVERN:
                    v[0] = 1.0
                
                for hid in range(len(self.heroes)):
                    h = self.heroes[hid]
                    if h['spawn_x'] == x and h['spawn_y'] == y:
                        v[2] = (1+self.mapPlayerIndexToTurnRel(hid)) / 4.0
                    if h['x'] == x and h['y'] == y:
                        v[3] = (1+self.mapPlayerIndexToTurnRel(hid)) / 4.0
                        v[4] = h['life'] / 100.0
                        if moneySum > 0:
                            v[5] = h['gold'] / moneySum
                        v[6] = h['mine_count'] / mineSum
                
                for idx in range(len(v)):
                    self.tensor[idx,y+self.yOff,x+self.xOff] = v[idx]
                
    def isTerminal(self):
        return self.max_turns <= self.turn

    def getWinner(self):
        idx = 0
        gold = self.heroes[0]['gold']
        
        for i in range(1, len(self.heroes)):
            if self.heroes[i]['gold'] > gold:
                gold = self.heroes[i]['gold']
                idx = i

        if gold == 0:
            return -1
        else:
            return idx

    def canTeachSomething(self):
        for h in self.heroes:
            if h['gold'] > 0:
                return True
            
        return False

    def _populate(self, game):
        for hero in game.heroes:
            h = dict(
                id         = hero.id,
                x          = hero.x,
                y          = hero.y,
                gold       = hero.gold,
                mine_count = hero.mine_count,
                life       = hero.life,
                spawn_x    = hero.spawn_x,
                spawn_y    = hero.spawn_y
            )
            self.heroes.append(h)

        for mine in game.mines:
            self.mines[(mine.x, mine.y)] = mine.owner

    def clone(self):
        return VindiniumState(self)

    def getPlayerOnTurnIndex(self):
        return self.turn % 4

    def kill(self, id, killer=None, recCount=0):  # @ReservedAssignment
        if recCount > 8:
            print("Bailing out of a kill. What is going on here?")
            print(str(self))
            return
        # TODO
# Bailing out of a kill. What is going on here?
# ====
# (2/89): 
#     1: (4, 8, l077, $12, m1)
#     2: (10, 10, l058, $0, m0)
#     3: (11, 5, l049, $3, m0)
#     4: (11, 10, l009, $0, m0)
# 
#  ----------------
# |################|
# |################|
# |######    ######|
# |#####      #####|
# |#####      #####|
# |####  #  # 3####|
# |####sT MM T ####|
# |####        ####|
# |####1       ####|
# |#### T MM T ####|
# |####s #  #24####|
# |#####      #####|
# |#####      #####|
# |######    ######|
# |################|
# |################|
#  ----------------
        
        '''Recursively kills a hero.'''
        hero = self.heroes[id]
        
        for i, h in enumerate(self.heroes):
            if i == id: continue
    
            if h['x']==hero['spawn_x'] and h['y']==hero['spawn_y']:
                self.kill(i, recCount = recCount + 1)
    
        hero['x'] = hero['spawn_x']
        hero['y'] = hero['spawn_y']
        hero['mine_count'] = 0
        hero['life'] = 100
    
        for pos in self.mines:
            value = self.mines[pos]
            if value == id+1:
                if killer is None:
                    self.mines[pos] = None
                else:
                    self.mines[pos] = killer+1
                    self.heroes[killer]['mine_count'] += 1

    def getMoveVector(self, move):
        if   move == 'North': d=( 0, -1)
        elif move == 'South': d=( 0,  1)
        elif move == 'West': d=(-1,  0)
        elif move == 'East': d=( 1,  0)
        elif move == 'Stay': d=( 0,  0)
        return d

    def getCurrentHero(self):
        ix = self.getPlayerOnTurnIndex()
        hero = self.heroes[ix]
        return hero, ix

    def preSimulateTensorClean(self):
        for hid, h in enumerate(self.heroes):
            px = h['x'] + self.xOff
            py = h['y'] + self.yOff
            self.tensor[3:7,py,px] = 0

    def postSimulateTensorUpdate(self):
        moneySum = 0.0
        for h in self.heroes:
            moneySum += float(h['gold'])
            
        mineSum = float(len(self.mines))
        
        for pos in self.mines:
            m = self.mines[pos]
            if m != None:
                self.tensor[1,pos[1] + self.yOff, pos[0] + self.xOff] = (self.mapPlayerIndexToTurnRel(m-1)+1) / 4.0
        
        for hid, h in enumerate(self.heroes):
            # update spawn position codes
            self.tensor[2,h['spawn_y'] + self.yOff,h['spawn_x'] + self.xOff] = (1+self.mapPlayerIndexToTurnRel(hid)) / 4.0
            px = h['x'] + self.xOff
            py = h['y'] + self.yOff
            self.tensor[3,py,px] = (1+self.mapPlayerIndexToTurnRel(hid)) / 4.0
            self.tensor[4,py,px] = h['life'] / 100.0
            if moneySum > 0:
                self.tensor[5,py,px] = h['gold'] / moneySum
            self.tensor[6,py,px] = h['mine_count'] / mineSum

    """
    Do one step of the simulation given a move for the current player.
    Mutate this object.
    """
    def simulate(self, move):
        move = commands[move]
        
        self.preSimulateTensorClean()
        
        self.last_move = move
    
        hero, id = self.getCurrentHero() # @ReservedAssignment
    
        # Compute next position
        d = self.getMoveVector(move)
        
        x_, y_ = hero['x']+d[0], hero['y']+d[1]
        hero_ = None
        for h in self.heroes:
            if h['x']==x_ and h['y']==y_:
                hero_ = h
                break
        
        gotKilled = False
        
        # prevent heroes from walking off the map
        if x_ > -1 and x_ < self.mapSize and y_ > -1 and y_ < self.mapSize:
            # Compute side effects of movement
            tile = self.map[x_, y_]
            
            if (tile == TILE_EMPTY or tile == TILE_SPAWN) and not hero_:
                # EMPTY -> Move hero
                hero['x'] = x_
                hero['y'] = y_
        
            elif tile == 3:
                # TAVERN
                if hero['gold'] > 2:
                    hero['gold'] -= 2
                    hero['life'] = min(hero['life']+50, 100)
                        
            elif tile == 4:
                # MINE
                mine = self.mines[x_, y_]
                
                # hero is not the mine's owner
                if mine != id+1:
                    # get mine
                    if hero['life'] > 20:
                        hero['life'] -= 20
                        hero['mine_count'] += 1
        
                        # remove mine from previous owner
                        if mine is not None:
                            self.heroes[mine-1]['mine_count'] -= 1
        
                        self.mines[x_, y_] = id + 1
        
                    # dies trying
                    else:
                        self.kill(id)
                        gotKilled = True
    
        # Fight
        if not gotKilled:
            for i, h in enumerate(self.heroes):
                if i == id: continue
        
                # Attack if 1-tile distance
                if abs(hero['x']-h['x'])+abs(hero['y']-h['y']) == 1:
                    if h['life'] > 20:
                        h['life'] -= 20
                    else:
                        self.kill(i, killer=id)
    
        # Mining
        hero['gold'] += hero['mine_count']
    
        # Thirst
        hero['life'] = max(hero['life']-1, 1)
    
        self.turn += 1
        
        self.postSimulateTensorUpdate()

    def __str__(self):
        s = '====\n(%d/%s): \n'%(1 + self.turn % 4, self.turn)
        for i, hero in enumerate(self.heroes):
            s += '    %d: (%d, %d, l%03d, $%d, m%d)\n'%\
                    (i+1, hero['x'], hero['y'], 
                        hero['life'], hero['gold'], 
                        hero['mine_count'])
        s += '\n '
        s += '-'*(self.map.size) + '\n'
        for y in range(self.map.size):
            s += '|'
            for x in range(self.map.size):
                tile = self.map[x, y]
                hero = [h for h in self.heroes if h['x']==x and h['y']==y]

                if tile == TILE_WALL: s += '#'
                elif any(hero): s+= str(hero[0]['id'])
                elif tile == TILE_SPAWN: s += 's'
                elif tile == TILE_MINE: s += 'M'
                elif tile == TILE_TAVERN: s += 'T'
                else: s += ' '
            s += '|\n'
        s += ' ' + '-'*(self.map.size)
        return s
    
    def getCommandList(self):
        return commands
    
    def isMoveLegal(self, move):
        """
        return True if the given move is legal
        """
        
        cmd = commands[move]
        
        #ignore STAY for now. Keeps the game simpler and really only matters for very high level play, if ever.
        if cmd == STAY:
            return False
        
        d = self.getMoveVector(cmd)
        
        hero, hid = self.getCurrentHero()
        x_, y_ = hero['x']+d[0], hero['y']+d[1]
        
        withinBounds = x_ > -1 and x_ < self.mapSize and y_ > -1 and y_ < self.mapSize 
        noWall = withinBounds and self.map[x_, y_] != TILE_WALL 
        noOwnMine = withinBounds and (self.map[x_, y_] != TILE_MINE or self.mines[x_, y_] != hid+1)
        
        isNoTavern = withinBounds and self.map[x_, y_] != TILE_TAVERN
        
        noHealthyTavern = isNoTavern or hero['life'] < 90
        noBrokeTavern = isNoTavern or hero['gold'] > 0

        return noWall and noOwnMine and noHealthyTavern and noBrokeTavern
    
